import React from 'react'
import LeftSide from '../LeftSide/LeftSide';
import ResourceSide from '../ResourceSide/ResourceSide';
import AppBar from '../AppBar/AppBar';
import './User.css'
import RightSide from '../RightSide/RightSide';
import FollowingCard from '../FollowingCard/FollowingCard';

const User = () => {
  return (
    <div className='user-page'>
      <div className='user-header'><AppBar/></div>
      <div className='user-page-down'>
      <div className='left'><LeftSide/></div>
      <div className='resource'><ResourceSide className='resource'/></div>
      <div className='right'><FollowingCard className='right'/></div>
      </div>
    </div>
  )
}

export default User
